=>'ชื่อธีม','Theme version.'=>'เวอร์ชั่นธีม','Theme.'=>'ธีม','There are currently no logs to view.'=>'ไม่มีบันทึกให้ดูในตอนนี้','There are no notes yet.'=>'ยังไม่มีข้อความ','There are no product reviews yet.'=>'ยังไม่มีรีวิวสำหรับสินค้านี้','There are no reviews yet.'=>'ยังไม่มีบทวิจารณ์','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'มี %s ในสต็อกไม่เพียงพอ กรุณาลดจำนวนในตะกร้าสินค้าของคุณ','There are some issues with the items in your cart. Please go back to the cart page and resolve these issues before checking out.'=>'มีปัญหาบางประการกับสินค้าในตะกร้าของคุณ กรุณาย้อนกลับไปที่หน้าตะกร้าสินค้า และแก้ไขก่อนดำเนินการสั่งซื้อ','There are three ways to add your products: you can <strong>create products manually, import them at once via CSV file</strong>, or <strong>migrate them from another service</strong>.<br/><br/>'=>'มีสามวิธีในการเพิ่มสินค้าของคุณ: คุณสามารถ <strong>สร้างสินค้าด้วยตนเอง นำเข้าพร้อมกันผ่านไฟล์ CSV</strong> หรือ <strong>ย้ายจากบริการอื่น</strong><br/><br/>','There are too many %s in the cart. Only 1 can be purchased. Please reduce the quantity in your cart.'=>'มี %s ในตะกร้าสินค้ามากเกินไป ซื้อได้อย่างละ 1 ชิ้นเท่านั้น กรุณาลดปริมาณในตะกร้าสินค้าของคุณ','There are too many %s in the cart. Only 1 of each can be purchased. Please reduce the quantities in your cart.'=>'มี %s ในตะกร้าสินค้ามากเกินไป ซื้อได้อย่างละ 1 ชิ้นเท่านั้น กรุณาลดปริมาณในตะกร้าสินค้าของคุณ','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'มี %s ในสต็อกไม่เพียงพอ กรุณาลดปริมาณในตะกร้าสินค้าของคุณ','There was a failure fetching this action'=>'ไม่สามารถดึงข้อมูลได้','There was an error calling %s'=>'มีข้อผิดพลาดในการเรียกใช้ %s','There was an error with an item in your cart.'=>'รายการในตะกร้าสินค้าผิดพลาด','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'ค่าใช้จ่ายเหล่นี้สามารถเลือกเพิ่มได้ตาม <a href="%s">ประเภทการจัดส่ง</a>','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'จะต้องตั้งหน้านี้เพื่อให้ WooCommerce รู้ว่าจะให้ผู้ใช้งานไปชำระเงินที่หน้าใด','These rates are extra shipping options with additional costs (based on the flat rate).'=>'อัตราเหล่านี้เป็นตัวเลือกการจัดส่งเพิ่มเติมพร้อมด้วยค่าใช้จ่ายเพิ่มเติม (คิดตามอัตราเดียว)','Thessaly'=>'Thessaly','Things to do next'=>'สิ่งที่ต้องทำถัดไป','This %s cannot be deleted'=>' %s ไม่สามารถลบได้','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'การดำเนินการนี้ไม่สามารถย้อนกลับได้ คุณแน่ใจหรือว่าต้องการล้างข้อมูลส่วนตัวจากยอดสั่งซื้อที่เลือกมาทั้งหมด','This controls how stock quantities are displayed on the frontend.'=>'คำสั่งนี้ควบคุมการแสดงผลของจำนวนที่เหลืออยู่ บนหน้าร้าน','This controls the description which the user sees during checkout.'=>'ส่วนควบคุมคำอธิบายแก่ผู้ใช้ระหว่างขั้นตอนการชำระเงิน','This controls the position of the currency symbol.'=>'ตัวเลือกนี้จะกำหนดตำแหน่งสัญลักษณ์สกุลเงิน','This controls the title which the user sees during checkout.'=>'สิ่งนี้ควบคุมหัวเรื่องที่ลูกค้าจะเห็นระหว่างกระบวนการสั่งซื้อสินค้า','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'ตัวเลือกนี้จะกำหนดสกุลเงินใดจะถูกระบุไว้ในแค็ตตาล็อกและสกุลเงินใดสำหรับการชำระเงิน','This controls what unit you will define lengths in.'=>'วิธีนี้จะควบคุมสินค้าที่คุณจะกำหนดความยาวให้','This controls what unit you will define weights in.'=>'วิธีนี้จะควบคุมสินค้าที่คุณจะกำหนดน้ำหนักให้','This controls which shipping address is used by default.'=>'ตัวควบคุมค่าเริ่มต้นที่อยู่ที่ผู้ใช้งานใช้ในการจัดส่งสินค้า','This coupon has expired.'=>'คูปองนี้หมดอายุแล้ว','This email address is already registered.'=>'อีเมลนี้เคยลงทะเบียนไปแล้ว','This function should not be called before woocommerce_init.'=>'ฟังก์ชั่นนี้ไม่ควรถูกเรียกใช้ก่อน woocommerce_init','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'ขณะนี้ร้านค้ากำลังอยู่ในช่วงการทดลอง &mdash; ไม่มีสินค้าอยู่ในร้าน','This is a featured product'=>'นี่เป็นสินค้าแนะนำ','This is an order notification sent to customers containing order details after payment.'=>'การแจ้งเตือนรายการสั่งซื้อนี้ถูกส่งไปยังลูกค้า ประกอบไปด้วยรายละเอียดการสั่งซื้อหลังจากชำระเงิน','This is not your download link.'=>'นี่ไม่ใช่ Link ในการดาวน์โหลดของคุณ','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'สินค้าที่ไม่มีรูปจะใช้ ID หรือ URL ของรูปภาพ โดยจะใช้สำหรับ placeholder ของรูปภาพในสินค้าแคตตาล็อก','This is the name of the download shown to the customer.'=>'นี่คือชื่อของไฟล์ดาวน์โหลดที่แสดงให้ลูกค้าเห็น','This is the sum of the "Tax rows" shipping tax amount within your orders.'=>'นี่คือผลรวมภาษีค่าจัดส่งของ “แถวภาษี” ภายในการสั่งซื้อของคุณ','This is the sum of the "Tax rows" tax amount within your orders.'=>'นี่คือผลรวมของ “อัตราภาษี" จำนวนเงินภาษีที่อยู่ในคำสั่งซื้อของคุณ','This is the sum of the \'Order total\' field within your orders.'=>'นี่คือผลรวมของ "รายการสั่งซื้อสินค้าทั้งหมด" ในรายการสั่งซื้อสินค้าของคุณ','This is the sum of the \'Shipping total\' field within your orders.'=>'นี่คือผลรวมของช่อง “ค่าจัดส่งทั้งหมด” ภายในการสั่งซื้อของคุณ','This is the sum of the order totals after any refunds and excluding shipping and taxes.'=>'จำนวนคำสั่งซื้อทั้งหมดหลังจากการคืนเงินโดยไม่รวมค่าขนส่งและภาษี','This is the sum of the order totals after any refunds and including shipping and taxes.'=>'จำนวนคำสั่งซื้อทั้งหมดหลังจากการคืนเงิน รวมค่าขนส่งและภาษี','This is the total tax for the rate (shipping tax + product tax).'=>'นี่คือภาษีรวมสำหรับอัตรานี้ (ภาษีการจัดส่ง+ภาษีสินค้า)','This is the URL or absolute path to the file which customers will get access to. URLs entered here should already be encoded.'=>'นี่คือ URL หรือเส้นทางสัมบูรณ์ (absolute path) ไปยังไฟล์ที่ลูกค้าจะได้รับการเข้าถึง URL ที่ใส่ที่นี่ควรถูกเข้ารหัสแล้ว','This is the WooCommerce shop page. The shop page is a special archive that lists your products. <a href="%s">You can read more about this here</a>.'=>'นี่คือหน้าสินค้าของ Woocommerce หน้าสินค้าจะเป็นที่พิเศษที่รวมสินค้าเอาไว้  <a href="%s">สามารถอ่านต่อ ได้ที่นี่</a>','This is where store orders are stored.'=>'รายการสั่งซื้อของร้านค้าจะถูกเก็บอยู่ที่นี่','This is where you can add new coupons that customers can use in your store.'=>'คุณสามารถเพิ่มคูปองใหม่ที่จะให้ลูกค้าใช้ได้ในร้านค้าที่นี่','This is where your business is located. Tax rates and shipping rates will use this address.'=>'นี้คือที่ตั้งของธุรกิจของคุณ อัตราภาษีและอัตราค่าจัดส่งจะใช้ที่อยู่นี้','This method is deprecated in 2.6.0 and will be removed in future versions - we recommend disabling it and instead setting up a new rate within your <a href="%s">Shipping zones</a>.'=>'<strong>คำเตือน: คำสั่งนี้หมดอายุในเวอร์ชั่น 2.6.0 และจะถูกนำออกในอนาคต เราแนะนำให้เลิกใช้งาน และตั้งอัตราค่าขนส่งใหม่ในหน้า <a href="%s">เขตการจัดส่ง</a></strong>','This method should not be called before plugins_loaded.'=>'method นี้ไม่ควรถูกเรียกก่อน plugins_loaded','This month'=>'เดือนนี้','This option determines a customers default location. The MaxMind GeoLite Database will be periodically downloaded to your wp-content directory if using geolocation.'=>'ตัวเลือกนี้จะเลือกสถานที่ค่าเริ่มต้นของลูกค้า ฐานข้อมูล MaxMind GeoLite จะถูกดาวน์โหลดเป็นระยะๆ ไปยังไดเร็กทอรี wp-content ของคุณหากใช้ตำแหน่งทางภูมิศาสตร์','This option determines which address is used to calculate tax.'=>'ตัวเลือกนี้จะกำหนดว่าระบบจะคำนวณภาษีโดยอิงจากที่อยู่ใด','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'ตัวเลือกนี้สำคัญมาก เนื่องจากมันจะกระทบกับราคาสินค้าที่คุณกรอก การเปลี่ยนตัวเลือกนี้จะไม่กระทบกับสินค้าที่อยู่ในระบบปัจจุบัน','This option lets you limit which countries you are willing to sell to.'=>'กำหนดประเทศที่ท่านต้องการจะขาย','This order cannot be paid for. Please contact us if you need assistance.'=>'คำสั่งซื้อไม่สามารถทำการจ่ายเงินได้ กรุณาติดต่อเราถ้าต้องการความช่วยเหลือ','This order is no longer editable.'=>'การสั่งซื้อนี้ไม่สามารถเปลี่ยนแปลงได้อีก','This order note cannot be deleted'=>'ไม่สามารถลบบันทึกของรายการสั่งซื้อนี้ได้','This order&rsquo;s status is &ldquo;%s&rdquo;&mdash;it cannot be paid for. Please contact us if you need assistance.'=>'สถานะรายการสั่งซื้อ &rsquo;s คือ &ldquo;%s&rdquo;&mdash; ซึ่งไม่สามารถทำการชำระเงินได้ กรุณาติดต่อเราหากต้องการความช่วยเหลือเพิ่มเติม','This password reset key is for a different user account. Please log out and try again.'=>'รหัสรีเซ็ตรหัสผ่านนี้ มีไว้สำหรับบัญชีผู้ใช้อื่น กรุณาออกจากระบบและลองใหม่อีกครั้ง','This payment method was successfully set as your default.'=>'ระบบการชำระเงินของคุณสำเร็จ ตั้งเหมือนค่าเริ่มต้น','This product has produced sales and may be linked to existing orders. Are you sure you want to delete it?'=>'สินค้านี้ได้ทำการขายแล้ว และอาจจะเชื่อมโยงกับคำสั่งซื้อที่มีอยู่ คุณแน่ใจใช่ไหมจะทำการลบ ?','This product is currently out of stock and unavailable.'=>'สินค้านี้หมดจากคลังสินค้า ไม่สามารถซื้อได้','This product is protected and cannot be purchased.'=>'สินค้านี้ถูกป้องกัน และไม่สามารถสั่งซื้อได้','This report link has expired. %1$sClick here to view the filtered report%2$s.'=>'ลิงก์รายงานนี้หมดอายุแล้ว %1$sโปรดคลิกที่นี่เพื่อดูตัวกรองรายงาน %2$s','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'ส่วนนี้ควบคุมการแสดงนโยบายความเป็นส่วนตัวของเว็บไซต์ของคุณ ประกาศเกี่ยวกับความเป็นส่วนตัวด้านล่างจะไม่ปรากฏขึ้นเว้นแต่จะมีการตั้ง %s ไว้แล้ว','This section lets you customize the WooCommerce emails. <a href="%s" target="_blank">Click here to preview your email template</a>.'=>'คุณสามารถปรับแต่งอีเมลของ WooCommerce ได้ที่ส่วนนี้ <a href="%s" target="_blank">คลิกที่นี่เพื่อดูตัวอย่าง Template อีเมลของคุณ</a>','This section shows any files that are overriding the default WooCommerce template pages.'=>'ในส่วนนี้จะแสดงไฟล์ที่ทำการเขียนทับไฟล์ตั้งต้นของหน้าเทมเพลต Woocommerce','This sets the base page of your shop - this is where your product archive will be.'=>'นี่จะตั้งค่าหน้าหลักสำหรับร้านของคุณ - นี่คือที่หน้าคลังเก็บสินค้าของคุณจะเป็น','This sets the decimal separator of displayed prices.'=>'ตัวเลือกนี้ใช้ตั้งค่าสัญลักษณ์ตัวแบ่งหลักทศนิยมของราคาที่แสดง','This sets the number of decimal points shown in displayed prices.'=>'ตัวเลือกนี้ใช้ตั้งค่าจำนวนหน่วยทศนิยม ของราคาที่แสดง','This sets the thousand separator of displayed prices.'=>'ตัวเลือกนี้ใช้ตั้งค่าสัญลักษณ์ตัวแบ่งหลักพันของราคาที่แสดง','This setting determines which shop pages products will be listed on.'=>'การตั้งค่านี้กำหนดว่าจะแสดงสินค้าในหน้าร้านค้าใด','This setting does not apply to guest purchases.'=>'การตั้งค่านี้ไม่ถูกนำไปใช้งานสำหรับการสั่งซื้อจากลูกค้าที่ไม่ได้เป็นสมาชิก','This shipping method does not have any settings to configure.'=>'วิธีการจัดส่งนี้ไม่มีการตั้งค่าที่สามารถปรับแก้ได้','This subscription has expired. Contact the owner to <strong>renew</strong> the subscription to receive updates and support.'=>'หมดอายุสมาชิกแล้ว ติดต่อเจ้าของผลิตภัณฑ์สำหรับการ<strong>ต่ออายุ</strong>สมาชิกเพื่อรับการอัปเดตและสนับสนุน','This subscription has expired. Please <strong>renew</strong> to receive updates and support.'=>'หมดอายุสมาชิกแล้วกรุณา<strong>ต่ออายุ</strong>เพื่อรับการอัปเดตและสนับสนุน','This subscription is expiring soon. Please <strong>renew</strong> to continue receiving updates and support.'=>'อายุสมาชิกกำลังจะหมดอายุในไม่ช้า กรุณา<strong>ต่ออายุ</strong>เพื่อได้รับการอัปเดตและการสนับสนุนอย่างต่อเนื่อง','This template has been overridden by your theme and can be found in: %s.'=>'Template นี้ถูกเขียนทับโดย Theme ของคุณทำไว้ และพบได้ใน <code>%s</code>','This text will be shown on the button linking to the external product.'=>'ข้อความนี้จะถูกแสดงบนปุ่มที่ลิงก์ไปยังสินค้าภายนอก','This tool allows you to generate and download a CSV file containing a list of all products.'=>'เครื่องมือนี้ช่วยให้คุณสร้างและดาวน์โหลดไฟล์ CSV ของรายการสินค้าทั้งหมด','This tool allows you to import (or merge) product data to your store from a CSV or TXT file.'=>'เครื่องมือนี้อนุญาตให้คุณนำเข้า(หรือรวม) ข้อมูลสินค้าเข้าไปในร้านค้าของคุณจากไฟล์ CSV หรือ TXT','This tool will clear ALL expired transients from WordPress.'=>'เครื่องมือนี้จะลบ Transients ที่หมดอายุทั้งหมดออกจากเวิร์ดเพรส','This tool will clear the product/shop transients cache.'=>'เครื่องมือนี้จะลบแคช Transients ของสินค้า/ร้านค้า','This tool will recount product terms - useful when changing your settings in a way which hides products from the catalog.'=>'เครื่องมือนี้จะเริ่มนับ Terms ใหม่ - มีประโยชน์ ในกรณีที่คุณเปลี่ยนแปลงการตั้งค่าเป็นการซ่อนข้อมูลสินค้าจากแค็ตตาล็อก','This tool will reset the admin, customer and shop_manager roles to default. Use this if your users cannot access all of the WooCommerce admin pages.'=>'เครื่องมือนี้จะล้างการตั้งค่าบทบาทของแอดมิน ลูกค้า และผู้จัดการร้านค้า กลับสู่ค่าเริ่มต้น ใช้เครื่องมือนี้เมื่อ ชื่อผู้ใช้ของคุณไม่สามารถเข้าสู่ระบบแอดมินของ WooCommerce ได้','This will be how your name will be displayed in the account section and in reviews'=>'ชื่อนี้จะแสดงในหน้าสมาชิก และหน้ารีวิวสินค้า','Thousand separator'=>'เครื่องหมายคั่นหลักพัน','Thousand separator.'=>'สัญลักษณ์คั่นหลักพัน','Thumbnail'=>'รูปขนาดเล็ก','Thumbnail cropping'=>'การ crop รูปย่อ','Thumbnail width'=>'ความกว้างของรูปย่อ','Thurgau'=>'Thurgau','Tianjin / 天津'=>'Tianjin / 天津','Tiaret'=>'Tiaret','Tibet / 西藏'=>'ทิเบต / 西藏','Ticino'=>'Ticino','Tierra del Fuego'=>'Tierra del Fuego','Timestamp'=>'Timestamp','Timor-Leste'=>'Timor-Leste','Tindouf'=>'Tindouf','Tipasa'=>'Tipasa','Tipperary'=>'Tipperary','Tissemsilt'=>'Tissemsilt','Title'=>'ชื่อ','Tizi Ouzou'=>'Tizi Ouzou','Tlaxcala'=>'Tlaxcala','Tlemcen'=>'Tlemcen','To connect to %1$s you need to be logged in. Log in to your store below, or <a href="%2$s">cancel and return to %1$s</a>'=>'เพื่อเชื่อมต่อกับ %1$s คุณต้องเข้าสู่ระบบก่อน   เข้าสู่ระบบร้านค้าของคุณด้านล่าง  หรือยกเลิก %2$s และกลับสู่ %1$s%3$s','To edit this order change the status back to "Pending payment"'=>'หากต้องการแก้ไขรายการสั่งซื้อนี้ ให้เปลี่ยนสถานะกลับเป็น "รอตรวจสอบ"','To enable this update you need to <strong>activate</strong> this subscription.'=>'เพื่อให้สามารถอัปเดตได้คุณจำเป็นต้อง<strong>เปิดใช้งาน</strong>การสมัครเป็นสมาชิก','To enable this update you need to <strong>purchase</strong> a new subscription.'=>'เพื่อให้สามารถอัปเดตได้คุณจำเป็นต้อง<strong>ชำระ</strong>ค่าสมาชิก','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'เพื่อให้แน่ใจได้ว่าคุณและลูกค้าของคุณจะได้รับการแจ้งเตือนในกล่องจดหมาย เราแนะนำให้เชื่อมต่ออีเมลของคุณเข้ากับชื่อเว็บไซต์ของคุณและบริการเซิร์ฟเวอร์ SMTP หากยังคงมีปัญหาการส่งเมลเราแนะนำให้ติดตั้ง <a href="%1$s">ปลั๊กอิน WP Mail Logging</a> หรือค้นหาข้อมูลเพิ่มเติมได้ที่<a href="%2$s">หน้า อีเมล FAQ</a>.','To opt out, leave this box unticked. Your store remains untracked, and no data will be collected. Read about what usage data is tracked at: %s.'=>'หากต้องการยกเลิก ให้ยกเลิกการเลือกช่องนี้ ร้านค้าของคุณไม่มีการติดตาม และจะไม่มีการรวบรวมข้อมูล อ่านเกี่ยวกับข้อมูลการใช้งานที่การติดตามได้ที่: %s.','To receive updates and support for this extension, you need to <strong>purchase</strong> a new subscription or consolidate your extensions to one connected account by <strong><a href="%1$s" title="Sharing Docs">sharing</a> or <a href="%2$s" title="Transferring Docs">transferring</a></strong> this extension to this connected account.'=>'หากต้องการรับการอัปเดตและสนับสนุนสำหรับส่วนขยายนี้ คุณจำเป็นต้อง<strong>ชำระค่าบริการ</strong> ค่าสมาชิกหรือต้องรวมเข้ากับบัญชีที่เชื่อมต่อโดย <strong><a href="%1$s" title="Sharing Docs">การแบ่งปัน</a> หรือ <a href="%2$s" title="Transferring Docs">การถ่ายโอน</a></strong> ส่วนขยายนี้เข้ากับบัญชีที