ipart emails, and also some extensions, will not work without DOMDocument.'=>'เซิร์ฟเวอร์ของคุณไม่ได้เปิดใช้ %s คลาส - อีเมลแบบ HTML/Multipart และส่วนเสริมอื่น ๆ จะใช้ไม่ได้ถ้าไม่ได้เปิดใช้ DOMDocument','Your server does not have the %s class enabled - some gateway plugins which use SOAP may not work as expected.'=>'เซิร์ฟเวอร์ของคุณไม่มีคลาส %s เปิดใช้ - ปลั๊กอินช่องทางชำระเงินบางตัวที่ ใช้ SOAP อาจจะไม่ทำงานได้อย่างที่คาดไว้','Your server does not support the %s function - this is required to use the GeoIP database from MaxMind.'=>'เซิร์ฟเวอร์ของคุณไม่รองรับ %s ฟังชั่น - ซึ่งจำเป็นต้องใช้กับ GeoIP database จาก MaxMind.','Your server does not support the %s functions - this is required for better character encoding. Some fallbacks will be used instead for it.'=>'เซิร์ฟเวอร์ของคุณไม่รองรับการทำงาน %s - มันต้องการการเข้ารหัสตัวอักษรที่ดีกว่านี้ การกลับไปใช้ของเดิมจะถูกใช้แทน','Your settings have been saved.'=>'บันทึกการตั้งค่าของคุณเรียบร้อย','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'เราต้องการที่อยู่ร้านค้าของคุณเพื่อตั้งค่าประเทศต้นทางในการจัดส่ง สกุลเงิน และตัวเลือกการจ่ายเงิน','Your store is almost ready! To activate services like %s, just connect with Jetpack.'=>'ร้านของคุณใกล้จะพร้อมแล้ว แค่ติดต่อกับ Jetpack และเปิดการทำงาน %s ','Your store\'s uploads directory is <a href="%1$s">browsable via the web</a>. We strongly recommend <a href="%2$s">configuring your web server to prevent directory indexing</a>.'=>'ร้านค้าของคุณอับโหลดไดเร็คทอรี่คือ <a href="%1$s">สามารถเปิดได้ผ่านเว็บ</a> เราแนะนำ <a href="%2$s">ให้ตั้งค่าป้องการ การเข้าถึงรายการไดเร็คทอรี่</a>.','Your theme has a woocommerce.php file, you will not be able to override the woocommerce/archive-product.php custom template since woocommerce.php has priority over archive-product.php. This is intended to prevent display issues.'=>'ธีมของคุณประกอบด้วยไฟล์ woocommerce.php ซึ่งคุณจะไม่สามารถ Override Custom เทมเพลต woocommerce/archive-product.php